import Badge from "react-bootstrap/Badge";


export default class App extends React.Component{
render(){
  return (
    <div className="App">
     <div className="container">
      <h1>
        <badge className="text-align-center" varient="light">
          Markdown Previewer
        </badge>
      </h1>
     </div>
    </div>
  );}
}
